import { Provider } from 'react-redux';
import './App.css';
import CinemaContentContainer from './Components/CinemaContent/CinemaContentContainer';
import store from './Redux/store';

function App() {
  return (
    <div className="App">
      <Provider store={store}>
        <CinemaContentContainer />
      </Provider>

    </div>
  );
}

export default App;
